import React from "react";
import NavBarView from "../components/NavBarView";
import {
  Box,
  Card,
  CardContent,
  CardMedia,
  Grid,
  IconButton,
  TextField,
  Typography,
} from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import Footer from "../components/Footer";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import prices from "../data/prices.json";
import AddIcon from "@mui/icons-material/Add";
import FruitDetails from "../components/FruitDetails";
import { useNavigate } from "react-router-dom";
import { useState } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
function Shop_page() {
  const navigate = new useNavigate();

  const getDetails = () => {
    navigate("/myCart", { state: { cart } });
  };

  const navigateto = () => {
    navigate("/fruitStore");
  };
  const [cart, setCart] = useState([]);

  //   const addToCart = (item) => {
  //     setCart([...cart, item]);
  //   };
  const [searchTerm, setSearchTerm] = useState("");
  const [filteredPrices, setFilteredPrices] = useState(prices);

  const handleSearch = () => {
    const filtered = prices.filter((price) =>
      price.name.toLowerCase().includes(searchTerm.toLowerCase())
    );
    setFilteredPrices(filtered);
  };

  const addToCart = async (e, data) => {
    const url = "http://localhost:5000/addcart";
    e.preventDefault();
    try {
      const submitData = data;
      const response = await axios.post(url, submitData);
      console.log(response);
    } catch (error) {
      alert(error);
    }
  };


  return (
    <>
      <NavBarView />
      <Box sx={{ width: "100%", height: "220vh", position: "relative" }}>
        <Box
          sx={{
            display: "flex",
            justifyContent: "space-between",
            paddingY: "20px",
            flexDirection: "column",
            width: "100%",
            height: { md: "50vh", xs: "30vh" },
            backgroundImage:
              'url("https://img2.exportersindia.com/product_images/bc-full/2019/2/4030954/fresh-oranges-1549538194-4565276.jpeg")',
            backgroundSize: "cover",
            position: "absolute",
          }}
        >
          <center>
            <Box
              sx={{
                width: "96%",
                display: "flex",
                justifyContent: "space-between",
              }}
            >
              <Typography
                sx={{
                  fontSize: { md: "50px", xs: "30px" },
                  color: "white",
                  fontWeight: "bold",
                }}
              >
                Shop
              </Typography>
              <IconButton onClick={getDetails}>
                <ShoppingCartIcon sx={{ color: "red" }} />
              </IconButton>
            </Box>
          </center>
          <center>
            <Box sx={{}}>
              <IconButton aria-label="search"  onClick={handleSearch}>
                <SearchIcon />
              </IconButton>
              <TextField
                sx={{}}
                placeholder="Search"
                size="small"
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
              />
            </Box>
          </center>
        </Box>
        <Box
          sx={{
            position: "absolute",
            marginTop: { md: "50vh", xs: "30vh" },
            background:
              "linear-gradient(0deg, rgba(21,34,56,1) 0%, rgba(198,194,192,1) 0%, rgba(83,79,14,1) 100%, rgba(0,75,10,1) 100%)",
            width: "100%" /* height: '100%' */,
          }}
        >
          <Box
            sx={{
              width: "100%",
              paddingX: "20px",
              flexGrow: "1",
              marginY: "40px",
            }}
          >
            <Grid container spacing={2}>
              {prices.map((prices, index) => (
                <Grid item md={3} xs={6} key={index}>
                  <Card>
                    <CardMedia
                      component="img"
                      image={prices.image}
                      sx={{ height: { xs: "180px", md: "290px" } }}
                      onClick={navigateto}
                    />
                    <CardContent
                      sx={{
                        display: "flex",
                        justifyContent: "space-between",
                        flexDirection: "row",
                      }}
                    >
                      <div>
                        <Typography sx={{ fontWeight: "bold" }}>
                          {prices.name}
                        </Typography>
                        {prices.price}
                      </div>
                      <div>
                        <IconButton
                          onClick={(event) => {
                            addToCart( prices);
                          }}
                        >
                          <AddIcon
                            sx={{
                              background: "orange ",
                              borderRadius: "50%",
                              color: "black",
                            }}
                          />
                        </IconButton>
                      </div>
                    </CardContent>
                  </Card>
                </Grid>
              ))}
            </Grid>
          </Box>
        </Box>
      </Box>
      <Footer />
    </>
  );
}

export default Shop_page;
